import React from 'react';

class Agenda extends React.Component{
	constructor(props){
		super(props);

		this.times = ['12:00AM']

	}

	render(){
		return(
			<div className='background'>
				<h1>Agenda</h1>
				<div className='foreground'>
					<TimeHR time={'8:00 AM'}/>
				</div>
			</div>
		);
	}

}

function TimeHR(props){

	const hrStyle= !props.time.includes('3') ? {borderBottomWidth: 2} : null;

	return(
		<div className='time-hr'>
			<hr style={hrStyle}/>
			<h5>{props.time}</h5>
		</div>
	);
}

export default Agenda;
